import React from 'react';
import MainBar from './MainBar';
import Search from './Search';
import CardList from './CardList';
import {
  Container,
  Grid
} from '@material-ui/core';

export default function Products({ data }) {
  return (
    <>
    <MainBar hasLogo />
    <div>
      <Search />
      <CardList data={data} />
    </div>
    </>
  );
}
